             states[ID].show = false;\n                states[ID].changed = true;\n                return true\n            end\n        end\n        \n        if not UnitExists(unit) or UnitPlayerControlled(unit) then return end\n        local DelayedSpell = aura_env.config.spellDelay and (aura_env.config.spellDelay > 0)\n        local castType = UnitCastingInfo(unit) and UnitCastingInfo or UnitChannelInfo\n        local _,_,icon,dur,exp,_,_,channelId,castId = castType(unit)\n        local spellId = UnitCastingInfo(unit) and castId or channelId\n        if DelayedSpell and (e == \"UNIT_SPELLCAST_START\" or e == \"UNIT_SPELLCAST_CHANNEL_START\") then\n            C_Timer.After(aura_env.config.spellDelay, function() WeakAuras.ScanEvents(\"UNIT_DELAYED_SPELL_START\", unit) end)\n            if states[ID] then\n                states[ID].show = false;\n                states[ID].changed = true;\n                return true\n            end\n        end\n        \n        if e == \"NAME_PLATE_UNIT_ADDED\" or e == \"UNIT_TARGET\" or \n        (DelayedSpell and (e == \"UNIT_DELAYED_SPELL_START\")) or \n        (not DelayedSpell and (e == \"UNIT_SPELLCAST_START\" or e == \"UNIT_SPELLCAST_CHANNEL_START\")) then\n            if UnitExists(unit..\"target\") and UnitIsUnit(unit..\"target\", \"player\") and \n            (icon and (isBoss and aura_env.BChat[spellId] ~= nil) or (not isBoss and aura_env.Chat[spellId] ~= nil)) then\n                states[ID] = states[ID] or {}\n                local state = states[ID]\n                if isBoss then\n                    if aura_env.BChat[spellId] then\n                        state.name = koKR and (GetSpellLink(spellId)..\" 대상\") or (\"Targeted by \"..GetSpellLink(spellId))\n                    else\n                        state.name = \"\"\n                    end\n                else\n                    local enrageStr = \"\"\n                    if aura_env.enrage then\n                        state.enraged = WA_GetUnitBuff(unit, 228318) and true or false\n                        if state.enraged then\n                            enrageStr = koKR and \"분노 \" or \"Enraged \"\n                        end\n                    end\n                    \n                    if aura_env.Chat[spellId] then\n                        state.name = koKR and (enrageStr..GetSpellLink(spellId)..\" 대상\") or \n                        (\"Targeted by \"..enrageStr..GetSpellLink(spellId))\n                    else\n                        state.name = \"\"\n                    end   \n                end\n                state.isBoss = isBoss\n                state.icon = icon\n                state.duration = (dur-exp)/1000\n                state.expirationTime = exp/1000\n                state.progressType = \"timed\"\n                state.autohide = true\n                state.show = true\n                state.changed = true\n                return true\n            else\n                if states[ID] then\n                    states[ID].show = false;\n                    states[ID].changed = true;\n                    return true\n                end\n            end\n        end\n    end\nend",
