l and event == \"UNIT_DELAYED_SPELL_START\") or\n        (not DelayedSpell and (event == \"UNIT_SPELLCAST_START\" or event == \"UNIT_SPELLCAST_CHANNEL_START\")) then \n            if UnitExists(unit..\"target\") and UnitIsUnit(unit..\"target\", \"player\") and (icon and aura_env.Target[spellId]) then\n                states[GUID] = states[GUID] or {}\n                local state = states[GUID]\n                state.unit = unit\n                state.show = true\n                state.changed = true\n                return true\n            else\n                if states[GUID] then\n                    states[GUID].show = false;\n                    states[GUID].changed = true;\n                    return true\n                end\n            end\n        end\n    end\nend",
