						["custom"] = "function(allstates, event, unit, ...)\n    if event == \"OPTIONS\"\n    and WeakAuras.IsOptionsOpen()\n    and aura_env.config.testMode then\n        for _, plate in pairs(C_NamePlate.GetNamePlates()) do\n            local unit = plate.namePlateUnitToken\n            local guid = UnitGUID(plate.namePlateUnitToken)\n            if unit\n            and guid then\n                local npcID = select(6, strsplit(\"-\", guid))\n                allstates[guid] = {\n                    show = true,\n                    changed = true,\n                    unit = unit,\n                    playerName = aura_env.config.overrideSettings and aura_env.config.showName and WA_ClassColorName(\"player\"),\n                    counter = 1,\n                    progressType = aura_env.config.showCastDuration and \"timed\",\n                    duration = 10,\n                    expirationTime = 10 + GetTime(),\n                }\n            end\n        end\n    elseif event == \"INSTANCE_ENCOUNTER_ENGAGE_UNIT\" then\n        for i = 1,5 do\n            local unit = \"boss\"..i\n            local guid = UnitGUID(unit)\n            if guid and not aura_env.counter[guid] then\n                local npcID = select(6, strsplit(\"-\", guid))\n                if npcID and aura_env.npcIDs[npcID] then\n                    aura_env.counter[guid] = 1\n                end\n            end\n        end\n    elseif event == \"UNIT_SPELLCAST_START\"\n    and (aura_env.config.showCastDuration or aura_env.config.emphasizeIcon)\n    and unit then\n        local _, spellID = ...\n        local guid = UnitGUID(unit)\n        if guid\n        and allstates[guid] then\n            local icon = GetRaidTargetIndex(unit)\n            local counter = aura_env.counter[guid]\n            local npcID = select(6, strsplit(\"-\", guid))\n            if aura_env.npcIDs[npcID] then\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                if isMyAssignment then\n                    if spellID and aura_env.spellIDs[tostring(spellID)] then\n                        if aura_env.config.showCastDuration then\n                            local _, _, _, startMS, endMS = UnitCastingInfo(unit)\n                            if endMS then\n                                allstates[guid].progressType = \"timed\"\n                                allstates[guid].duration = ((endMS-startMS)/1000)\n                                allstates[guid].expirationTime = (endMS/1000)\n                            end\n                        end\n                        allstates[guid].isCasting = true\n                        return true\n                    end\n                end\n            end\n        end\n        --iterates through visible nameplates and checks for specified raidicon.  \n    elseif event == \"RAID_TARGET_UPDATE\"\n    and (aura_env.config.specifiedMark ~= 9 or aura_env.config.overrideSettings) then \n        for _, plate in pairs(C_NamePlate.GetNamePlates()) do\n            local u = plate.namePlateUnitToken\n            local guid = UnitGUID(plate.namePlateUnitToken)\n            local icon = GetRaidTargetIndex(u)\n            if u\n            and guid\n            and aura_env.npcIDs[select(6,strsplit(\"-\", guid))]\n            and \n            (\n                (not allstates[guid] and (aura_env.config.specifiedMark == icon or aura_env.myERTMarks[icon]))\n                or (not allstates[guid] and aura_env.config.raidLeader and aura_env.ERTLimits[icon])\n            )\n            then\n                if not aura_env.counter[guid] then\n                    aura_env.counter[guid] = 1\n                end\n                local counter = aura_env.counter[guid]\n                allstates[guid] = {\n                    show = true,\n                    changed = true,\n                    counter = counter,\n                    unit = u,\n                    icon = icon or 0,\n                    myAssignment = aura_env.checkAssignment(counter, icon)\n                }\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                if isMyAssignment then\n                    PlaySoundFile(aura_env.sound[aura_env.config.specifiedSound], \"MASTER\")\n                    local _, _, _, startMS, endMS, _, _, _, spellId = UnitCastingInfo(u)\n                    if spellId and aura_env.spellIDs[tostring(spellId)] then\n                        if aura_env.config.showCastDuration then\n                            allstates[guid].progressType = \"timed\"\n                            allstates[guid].duration = ((endMS-startMS)/1000)\n                            allstates[guid].expirationTime = (endMS/1000)\n                        end\n                        allstates[guid].isCasting = true\n                    end\n                end\n                if aura_env.showName then\n                    allstates[guid].playerName = aura_env.assignments[icon] and aura_env.assignments[icon][counter]\n                end\n            end\n        end\n        return true\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellschool, extraspellID, extraspellName  = ...\n        if subEvent == \"SPELL_CAST_SUCCESS\"\n        and aura_env.spellIDs[tostring(spellID)] then\n            local npcID = select(6, strsplit(\"-\", sourceGUID))\n            if aura_env.npcIDs[npcID] then\n                local state = allstates[sourceGUID]\n                local icon = aura_env.translate[sourceRaidFlags]\n                \n                WeakAuras.ScanEvents(\"CAUSESE_INTERRUPT_MISSED\", GetTime(), icon, aura_env.counter[sourceGUID] or 1, aura_env.assignments[icon] and aura_env.assignments[icon][aura_env.counter[sourceGUID] or 1])\n                \n                if aura_env.counter[sourceGUID] then\n                    aura_env.counter[sourceGUID] = aura_env.counter[sourceGUID] + 1\n                else\n                    aura_env.counter[sourceGUID] = 2 \n                end\n                --check if current count == limit and reset to 1\n                if not aura_env.config.overrideSettings then\n                    local limit = aura_env.config.limit\n                    if aura_env.counter[sourceGUID] == (limit+1) and limit > 0 then\n                        aura_env.counter[sourceGUID] = 1\n                    end\n                else\n                    local limit = aura_env.ERTLimits[icon]\n                    if limit and aura_env.counter[sourceGUID] == (limit+1) and limit > 0 then\n                        aura_env.counter[sourceGUID] = 1\n                    end\n                end\n                local counter = aura_env.counter[sourceGUID]\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                --update state\n                if state then\n                    state.changed = true\n                    state.counter = counter\n                    state.playerName = aura_env.showName and aura_env.assignments[icon] and aura_env.assignments[icon][counter]\n                    state.isCasting = false\n                    state.myAssignment = isMyAssignment\n                end\n                --fire sound if it matches your specified value\n                if isMyAssignment then\n                    PlaySoundFile(aura_env.sound[aura_env.config.specifiedSound], \"MASTER\")   \n                end\n                return true\n            end\n        elseif subEvent == \"SPELL_INTERRUPT\"\n        and aura_env.spellIDs[tostring(extraspellID)] then\n            local npcID = select(6, strsplit(\"-\", destGUID))\n            if aura_env.npcIDs[npcID] then\n                local state = allstates[destGUID]\n                local icon = aura_env.translate[destRaidFlags]\n                --increase count\n                if aura_env.counter[destGUID] then\n                    aura_env.counter[destGUID] = aura_env.counter[destGUID] + 1\n                else\n                    aura_env.counter[destGUID] = 2\n                end\n                --update state with new count\n                if not aura_env.config.overrideSettings then\n                    local limit = aura_env.config.limit\n                    if aura_env.counter[destGUID] == (limit+1) and limit > 0 then\n                        aura_env.counter[destGUID] = 1\n                    end\n                else\n                    local limit = aura_env.ERTLimits[icon]\n                    if limit and aura_env.counter[destGUID] == (limit+1) and limit > 0 then\n                        aura_env.counter[destGUID] = 1\n                    end\n                end\n                local counter = aura_env.counter[destGUID]\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                if state then\n                    state.changed = true\n                    state.counter = counter\n                    state.playerName = aura_env.showName and aura_env.assignments[icon] and aura_env.assignments[icon][counter]\n                    state.isCasting = false\n                    state.myAssignment = isMyAssignment\n                end\n                -- fire sound if it matches your specified value\n                if isMyAssignment then\n                    PlaySoundFile(aura_env.sound[aura_env.config.specifiedSound], \"MASTER\")   \n                end\n                return true\n            end\n        elseif subEvent == \"SPELL_CAST_START\"\n        and aura_env.spellIDs[tostring(spellID)] then\n            local npcID = select(6, strsplit(\"-\", sourceGUID))\n            if aura_env.npcIDs[npcID] then\n                if not aura_env.counter[sourceGUID] then\n                    aura_env.counter[sourceGUID] = 1\n                end\n                local icon = aura_env.translate[sourceRaidFlags]\n                local counter = aura_env.counter[sourceGUID]\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                if isMyAssignment then\n                    PlaySoundFile(aura_env.castsound[aura_env.config.specifiedCastSound], \"MASTER\")\n                end\n            end\n        end\n    elseif event == \"NAME_PLATE_UNIT_ADDED\" and unit then\n        local guid = UnitGUID(unit)\n        local icon = GetRaidTargetIndex(unit)\n        if guid then\n            if aura_env.npcIDs[select(6,strsplit(\"-\", guid))] \n            and\n            (\n                (\n                    aura_env.config.specifiedMark ~= 9\n                    and aura_env.config.specifiedMark == GetRaidTargetIndex(unit)\n                )\n                or not aura_env.config.overrideSettings and aura_env.config.specifiedMark == 9\n                or aura_env.myERTMarks[icon]\n                or aura_env.config.overrideSettings and aura_env.config.raidLeader and aura_env.ERTLimits[icon]\n            )\n            then\n                if not aura_env.counter[guid] then\n                    aura_env.counter[guid] = 1\n                end\n                local counter = aura_env.counter[guid]\n                allstates[guid] = {\n                    unit = unit,\n                    show = true,\n                    counter = counter,\n                    changed = true,\n                    icon = icon or 0,\n                    myAssignment = aura_env.checkAssignment(counter, icon),\n                    isCasting = false\n                }\n                local isMyAssignment = aura_env.checkAssignment(counter, icon)\n                if isMyAssignment then\n                    local _, _, _, startMS, endMS, _, _, _, spellId = UnitCastingInfo(unit)\n                    if spellId and aura_env.spellIDs[tostring(spellId)] then\n                        if aura_env.config.showCastDuration then\n                            allstates[guid].progressType = \"timed\"\n                            allstates[guid].duration = ((endMS-startMS)/1000)\n                            allstates[guid].expirationTime = (endMS/1000)\n                        end\n                        allstates[guid].isCasting = true\n                    end\n                end\n                if aura_env.showName then\n                    allstates[guid].playerName = aura_env.assignments[icon] and aura_env.assignments[icon][counter]\n                end\n                return true\n            end\n        end\n    elseif event == \"NAME_PLATE_UNIT_REMOVED\" and unit then\n        local guid = UnitGUID(unit)\n        if guid then\n            local state = allstates[guid]\n            if state then\n                state.changed = true\n                state.unit = \"none\" --to hide WA without killing state\n                return true\n            end\n        end\n    elseif event == \"ENCOUNTER_START\" then\n        aura_env.showName = aura_env.config.overrideSettings and (aura_env.config.showName or aura_env.config.raidLeader)\n        \n        aura_env.assignments = {}\n        for i = 1,8 do\n            aura_env.assignments[i] = {}\n        end\n        \n        aura_env.npcIDs = {}\n        aura_env.spellIDs = {}\n        aura_env.myERTMarks = {}\n        aura_env.myERTInterrupts = {}\n        aura_env.ERTLimits = {}\n        for match in aura_env.config.npcID:gmatch(\"%d+\") do aura_env.npcIDs[match] = true end\n        for match in aura_env.config.spellID:gmatch(\"%d+\") do aura_env.spellIDs[match] = true end\n        aura_env.counter = {}\n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\"))\n        and _G.VExRT.Note.Text1 \n        and aura_env.config.overrideSettings then\n            local text = _G.VExRT.Note.Text1\n            --counts lines except gaps\n            local betweenLine = false\n            local myName = UnitName(\"player\")\n            for line in text:gmatch('[^\\r\\n]+') do\n                --searches for \"endLine\" in Note\n                if line == \"endLine\" then\n                    betweenLine = false\n                end\n                if betweenLine then\n                    local mark = line:match(\"^{([^}]+)}\")\n                    if mark and aura_env.translateERT[mark] then\n                        local turn = 0\n                        local backupsList = {}\n                        for backups in line:gmatch(\"%(([^)]*)%)\") do\n                            local isbackup = false\n                            for name in backups:gmatch(\"|c%x%x%x%x%x%x%x%x([^|]+)|\") do\n                                if isbackup then\n                                    backupsList[name] = true\n                                end\n                                isbackup = true\n                            end \n                        end\n                        for name in line:gmatch(\"|c%x%x%x%x%x%x%x%x([^|]+)|\") do\n                            if not backupsList[name] then\n                                turn = turn + 1\n                            else\n                                backupsList[name] = nil\n                            end\n                            \n                            aura_env.assignments[aura_env.translateERT[mark]][turn] = UnitExists(name) and WA_ClassColorName(name) or name\n                            \n                            --if name from note matches with yours then...\n                            if name == myName then\n                                if not aura_env.myERTInterrupts[aura_env.translateERT[mark]] then\n                                    aura_env.myERTInterrupts[aura_env.translateERT[mark]] = {}\n                                    aura_env.myERTInterrupts[aura_env.translateERT[mark]][turn] = true\n                                else\n                                    aura_env.myERTInterrupts[aura_env.translateERT[mark]][turn] = true\n                                end\n                                aura_env.myERTMarks[aura_env.translateERT[mark]] = true\n                            end\n                        end\n                        aura_env.ERTLimits[aura_env.translateERT[mark]] = turn\n                    end\n                end\n                --searches for \"startLine\" in Note\n                if line == \"startLine\" then\n                    betweenLine = true\n                    --disable all currently specified interrupts / marks so only ERT handles them\n                    aura_env.config.specifiedMark = 9\n                    for i = 1,8 do\n                        aura_env.config.specifiedInterrupts[i] = false\n                    end\n                end\n            end\n        end\n        --weakaura used to lack something to anchor interruptorder to when units are present on pull\n        for _, plate in pairs(C_NamePlate.GetNamePlates()) do\n            local unit = plate.namePlateUnitToken\n            if unit then\n                local guid = UnitGUID(plate.namePlateUnitToken)\n                local icon = GetRaidTargetIndex(unit)\n                if guid\n                and aura_env.npcIDs[select(6, strsplit(\"-\", guid))]\n                and\n                (\n                    aura_env.config.specifiedMark ~= 9\n                    and icon\n                    and aura_env.config.specifiedMark == icon\n                    or (not aura_env.config.overrideSettings and aura_env.config.specifiedMark == 9)\n                    or aura_env.myERTMarks[icon]\n                    or aura_env.config.overrideSettings and aura_env.config.raidLeader and aura_env.ERTLimits[icon]\n                )\n                then\n                    if not aura_env.counter[guid] then\n                        aura_env.counter[guid] = 1\n                    end\n                    local counter = aura_env.counter[guid]\n                    allstates[guid] = {\n                        show = true,\n                        changed = true,\n                        counter = counter,\n                        unit = unit,\n                        icon = icon or 0,\n                        myAssignment = aura_env.checkAssignment(counter, icon),\n                    }\n                    if aura_env.showName then\n                        allstates[guid].playerName = aura_env.assignments[icon] and aura_env.assignments[icon][counter]\n                    end\n                end\n            end\n        end\n        return true\n    end    \nend",
