				},
				["init"] = {
					["custom"] = "local locals = {\n    --- Raid Target Icon [ENG]\n    {\n        \"star\",\n        \"circle\",\n        \"diamond\",\n        \"triangle\",\n        \"moon\",\n        \"square\",\n        \"cross\",\n        \"skull\",\n    },\n    --- Raid Target Icon [DE]\n    {\n        \"stern\",\n        \"kreis\",\n        \"diamant\",\n        \"dreieck\",\n        \"mond\",\n        \"quadrat\",\n        \"kreuz\",\n        \"totenschädel\",\n    },\n    --- Raid Target Icon [FR]\n    {\n        \"étoile\",\n        \"cercle\",\n        \"losange\",\n        \"triangle\",\n        \"lune\",\n        \"carré\",\n        \"croix\",\n        \"crâne\",\n    },\n    --- Raid Target Icon [IT]\n    {\n        \"stella\",\n        \"cerchio\",\n        \"rombo\",\n        \"triangolo\",\n        \"luna\",\n        \"quadrato\",\n        \"croce\",\n        \"teschio\",\n    },\n    --- Raid Target Icon [RU]\n    {\n        \"звезда\",\n        \"круг\",\n        \"ромб\",\n        \"треугольник\",\n        \"полумесяц\",\n        \"квадрат\",\n        \"крест\",\n        \"череп\",\n    },\n    --- Raid Target Icon [ES]\n    {\n        \"dorado\",\n        \"naranja\",\n        \"morado\",\n        \"verde\",\n        \"plateado\",\n        \"azul\",\n        \"rojo\",\n        \"blanco\",\n    },\n    --- Raid Target Icon [PT]\n    {\n        \"dourado\",\n        \"laranja\",\n        \"roxo\",\n        \"verde\",\n        \"prateado\",\n        \"azul\",\n        \"vermelho\",\n        \"branco\",\n    }\n}\n\naura_env.translateERT = {}\nfor _, loc in ipairs(locals) do\n    for j, v in ipairs(loc) do\n        aura_env.translateERT[v] = j\n    end\nend\nfor k, v in pairs(ICON_TAG_LIST) do\n    aura_env.translateERT[k] = v\nend\n\naura_env.npcIDs = {}\naura_env.spellIDs = {}\naura_env.counter = aura_env.counter or {}\n\naura_env.sound = {\n    [1] = \"None\",\n    [2] = \"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Sounds\\\\RingingPhone.ogg\",\n    [3] = \"Interface\\\\AddOns\\\\SharedMedia_Causese\\\\sound\\\\Next.ogg\",\n}\n\naura_env.castsound = {\n    [1] = \"None\",\n    [2] = \"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Sounds\\\\AirHorn.ogg\",\n    [3] = \"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Sounds\\\\BikeHorn.ogg\",\n    [4] = \"Interface\\\\AddOns\\\\SharedMedia_Causese\\\\sound\\\\Interrupt.ogg\",\n}\naura_env.myERTMarks = {}\n\naura_env.translateERT = {}\nfor _, loc in ipairs(locals) do\n    for j, v in ipairs(loc) do\n        aura_env.translateERT[v] = j\n    end\nend\nfor k, v in pairs(ICON_TAG_LIST) do\n    aura_env.translateERT[k] = v\nend\n\naura_env.sendemote = {\n    [1] = \"STAR\",\n    [2] = \"CIRCLE\",\n    [4] = \"DIAMOND\",\n    [8] = \"TRIANGLE\",\n    [16] = \"MOON\",\n    [32] = \"SQUARE\",\n    [64] = \"CROSS\",\n    [128] = \"SKULL\",\n}\n\n--sourceRaidFlags to icon number \naura_env.translate = {\n    [1] = 1,\n    [2] = 2,\n    [4] = 3,\n    [8] = 4,\n    [16] = 5,\n    [32] = 6,\n    [64] = 7,\n    [128] = 8,\n}\n\naura_env.checkAssignment = function(counter, icon)\n    if counter and\n    (\n        aura_env.config.specifiedInterrupts[counter]\n        or aura_env.config.overrideSettings\n        and aura_env.myERTInterrupts[icon] and aura_env.myERTInterrupts[icon][counter]\n    )\n    and\n    (\n        (\n            icon and \n            (\n                aura_env.config.specifiedMark ~= 9\n                and aura_env.config.specifiedMark == icon\n                or aura_env.myERTMarks[icon]\n            )\n        )\n        or not aura_env.config.overrideSettings and aura_env.config.specifiedMark == 9\n    )\n    then\n        return true\n    end\nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
