						["custom"] = "function(states, event, ...)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        if not ... then return end\n        local _,subevent,_,_,_,_,_,GUID = ...\n        if not states[GUID] then return end\n        \n        if subevent == \"UNIT_DIED\" then\n            if states[GUID] then\n                states[GUID].show = false;\n                states[GUID].changed = true;\n                return true\n            end\n        end\n        \n    else\n        local unit = ... \n        if not unit then return end\n        local GUID = UnitGUID(unit)\n        \n        if (event == \"NAME_PLATE_UNIT_REMOVED\" or event ==\"UNIT_SPELLCAST_STOP\" or event == \"UNIT_SPELLCAST_CHANNEL_STOP\") then\n            if states[GUID] then\n                states[GUID].show = false;\n                states[GUID].changed = true;\n                return true\n            end\n        end\n        \n        if not UnitExists(unit) or UnitPlayerControlled(unit) then return end\n        local castType = UnitCastingInfo(unit) and UnitCastingInfo or UnitChannelInfo\n        local _,_,icon,dur,exp,_,_,channelId,castId = castType(unit)\n        local spellId = UnitCastingInfo(unit) and castId or channelId\n        if (event == \"NAME_PLATE_UNIT_ADDED\" or event == \"UNIT_TARGET\" or event == \"UNIT_SPELLCAST_START\" or event == \"UNIT_SPELLCAST_CHANNEL_START\") then\n            if (icon and aura_env.Frontal[spellId]) then\n                if (UnitExists(unit..\"target\") and UnitIsUnit(unit..\"target\", \"player\")) and aura_env.exc[spellId] then\n                    if states[GUID] and aura_env.exc[states[GUID].spellId] then\n                        states[GUID].show = false\n                        states[GUID].changed = true\n                        return true\n                    end\n                else\n                    states[GUID] = states[GUID] or {}\n                    local state = states[GUID]\n                    state.spellId = spellId\n                    if UnitThreatSituation(\"player\", unit) and UnitGroupRolesAssigned(\"player\") == \"TANK\" then\n                        if _G.LOCALE_koKR then\n                            state.name = \"전방 \"..GetSpellLink(spellId)\n                        else\n                            state.name = \"Frontal \"..GetSpellLink(spellId)\n                        end\n                    else\n                        state.name = \"\"\n                    end   \n                    state.unit = unit\n                    state.changed = true\n                    state.show = true\n                    return true\n                end\n            else\n                if states[GUID] then\n                    states[GUID].show = false;\n                    states[GUID].changed = true;\n                    return true\n                end\n            end\n        end\n    end\nend",
