						["custom"] = "-- CLEU:SPELL_CAST_START:SPELL_AURA_REMOVED:SPELL_PERIODIC_HEAL:SPELL_HEAL, LAUVLY_AFFLICTED\n\nfunction(states, event, ...)\n    if event == \"OPTIONS\" then\n        states[1] = {\n            name = aura_env.target[\"name\"],\n            value = 500,\n            total = 5000,\n            percent = 10,\n            progressType = \"static\",\n            autoHide = false,\n            show = true,\n            changed = true\n        }\n        states[2] = {\n            name = aura_env.target[\"name\"],\n            value = 2500,\n            total = 5000,\n            percent = 50,\n            progressType = \"static\",\n            autoHide = false,\n            show = true,\n            changed = true\n        }\n        \n        return true\n    elseif event == \"LAUVLY_AFFLICTED\" and ... then\n        local guid = ...\n        \n        aura_env.debugLog(\"AFFIX EXPIRED\")\n        \n        if states[guid] ~= nil and states[guid][\"show\"] then\n            states[guid] = {\n                show = false,\n                changed = true\n            }\n            \n            return true\n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, subevent, _, sourceGUID, _, _, _, destGUID, destName = ...\n        local spellID = select(12, ...)\n        \n        if subevent == \"SPELL_CAST_START\" and spellID == aura_env.target[\"cast\"] then\n            states[sourceGUID] = {\n                name = aura_env.target[\"name\"],\n                value = 1,\n                total = 10000,\n                percent = 0.1,\n                progressType = \"static\",\n                autoHide = false,\n                show = true,\n                changed = true\n            }\n            \n            C_Timer.After(10.1, function() WeakAuras.ScanEvents(\"LAUVLY_AFFLICTED\", sourceGUID) end)\n            \n            return true\n        elseif \n        subevent == \"SPELL_AURA_REMOVED\" and \n        (spellID == 409465 or spellID == 409470 or spellID == 409472) and\n        states[sourceGUID] ~= nil and\n        states[sourceGUID][\"show\"]\n        then\n            aura_env.debugLog(\"AFFIX DISPELLED\")\n            \n            states[sourceGUID] = {\n                show = false,\n                changed = true\n            }\n            \n            return true\n        elseif (subevent == \"SPELL_PERIODIC_HEAL\" or subevent == \"SPELL_HEAL\") and destName == aura_env.target[\"name\"] then\n            local overheal = select(16, ...)\n            \n            if \n            overheal > 0 and \n            states[destGUID] ~= nil and\n            states[destGUID][\"show\"] \n            then\n                aura_env.debugLog(\"AFFIX HEALED\")\n                \n                states[destGUID] = {\n                    show = false,\n                    changed = true\n                }\n                \n                return true\n            end\n            \n            if destGUID ~= nil then \n                local unit = UnitTokenFromGUID(destGUID)\n                \n                if unit ~= nil and states[destGUID] ~= nil then\n                    local health = UnitHealth(unit)\n                    local healthMax = UnitHealthMax(unit)\n                    \n                    if health >= healthMax then\n                        aura_env.debugLog(\"AFFIX HEALED\")\n                        \n                        states[destGUID] = {\n                            show = false,\n                            changed = true\n                        }\n                        \n                        return true\n                    end\n                    \n                    states[destGUID][\"value\"] = health\n                    states[destGUID][\"total\"] = healthMax\n                    states[destGUID][\"percent\"] = (health / healthMax) * 100\n                    states[destGUID][\"changed\"] = true\n                    \n                    return true\n                end\n            end\n        end\n    end\n    \n    return false\nend",
