		["<Arctic Avengers> Igara - Blistering Spear 1.2"] = {
			["iconSource"] = 0,
			["xOffset"] = -1.666748046875,
			["customText"] = "function()\n    if not aura_env.states[1] or not aura_env.states[2].affected then\n        return nil\n    end\n    \n    local debuffedPlayers = {}\n    for unit in string.gmatch(aura_env.states[2].affected:gsub(\"%s+\", \"\"), '([^,]+)') do\n        table.insert(debuffedPlayers, UnitGUID(unit))\n    end\n    \n    table.sort(debuffedPlayers)\n    \n    local groupSize = math.ceil(#debuffedPlayers / 3)\n    local playerPosition = nil\n    local currentPlayerID = UnitGUID(\"player\")\n    \n    for group, unitId in ipairs(debuffedPlayers) do\n        local raidPlayerGuid = unitId\n        if group <= groupSize then\n            if raidPlayerGuid == currentPlayerID then\n                playerPosition = \"LEFT\"\n            end\n        elseif group > groupSize and group <= 2 * groupSize then\n            if raidPlayerGuid == currentPlayerID then\n                playerPosition = \"RIGHT\"\n            end\n        else\n            if raidPlayerGuid == currentPlayerID then\n                playerPosition = \"MIDDLE\"\n            end\n        end\n    end\n    \n    SendChatMessage(playerPosition, \"SAY\");\n    \n    return playerPosition\nend",
